// 话说江湖上有一个神秘任务，名为快速排序。
// 非凡剑派掌门李逍遥便是这次任务的主角。他的武功秘籍是分而治之法，
// 只要掌握精髓，就能瞬间搞定乱糟糟的武侠界大事。

function quickSort(arr) {
  // 话说若无武林至宝（即数组元素小于等于一），李逍遥便可以安然归去
  if (arr.length <= 1) return arr;

  // 取门派长老，名为枢轴点。这位长老之剑锋利无比，能轻易切割一切。
  const pivot = arr[0];
  // 切割出左派兄弟（即比枢轴小的弟子），右派兄弟同理。
  const left = [];
  const right = [];

  // 开启大阵，寻找所有符合条件的小弟。武林人士莫要怕，这里是比武招亲之地，
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 结束大阵，开启分枝。左派兄弟先走，随后是剑主李逍遥的豪迈之躯，
  return [...quickSort(left), pivot, ...quickSort(right)];
}
